// SPDX-License-Identifier: MIT
pragma solidity ^0.8.22;

/**
 * @title PunctualityCore
 * @dev Core contract for punctuality betting protocol
 * Migrates ETA calculation logic from TypeScript to smart contract
 * Maintains single source of truth for all punctuality commitments
 */
contract PunctualityCore {
    // Events
    event CommitmentCreated(
        bytes32 indexed commitmentId,
        address indexed user,
        uint256 stakeAmount,
        uint256 arrivalDeadline,
        LocationData startLocation,
        LocationData targetLocation
    );

    event CommitmentFulfilled(
        bytes32 indexed commitmentId,
        address indexed user,
        bool successful,
        uint256 actualArrivalTime,
        uint256 rewardAmount
    );

    event BetPlaced(
        bytes32 indexed commitmentId,
        address indexed bettor,
        uint256 betAmount,
        bool bettingFor
    );

    // Structs
    struct LocationData {
        int256 latitude;   // Scaled by 1e6 for precision
        int256 longitude;  // Scaled by 1e6 for precision
        uint256 accuracy;  // In meters
        uint256 timestamp;
    }

    struct ETACommitment {
        address user;
        uint256 stakeAmount;
        uint256 commitmentTime;
        uint256 arrivalDeadline;
        LocationData startLocation;
        LocationData targetLocation;
        uint256 estimatedDistance; // In meters
        uint256 estimatedPace;     // Minutes per mile * 100
        bool fulfilled;
        bool successful;
        uint256 actualArrivalTime;
        uint256 totalBetsFor;
        uint256 totalBetsAgainst;
    }

    struct Bet {
        address bettor;
        uint256 amount;
        bool bettingFor; // true = betting user will make it, false = betting they won't
        bool claimed;
    }

    // State variables
    mapping(bytes32 => ETACommitment) public commitments;
    mapping(bytes32 => Bet[]) public commitmentBets;
    mapping(address => uint256) public userReputationScore;
    mapping(address => uint256) public userTotalStaked;
    mapping(address => uint256) public userSuccessfulCommitments;
    mapping(address => uint256) public userTotalCommitments;

    uint256 public constant PROTOCOL_FEE = 250; // 2.5% in basis points
    uint256 public constant EARTH_RADIUS_METERS = 6371000;
    uint256 public constant INITIAL_REPUTATION = 7500; // 75% starting reputation

    address public owner;
    uint256 public protocolFeeBalance;

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can perform this action");
        _;
    }

    modifier validCommitment(bytes32 commitmentId) {
        require(commitments[commitmentId].user != address(0), "Commitment does not exist");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    /**
     * @dev Create a new punctuality commitment
     * Enhanced version of existing session creation with staking
     */
    function createCommitment(
        LocationData memory startLocation,
        LocationData memory targetLocation,
        uint256 arrivalDeadline,
        uint256 estimatedPace
    ) external payable returns (bytes32) {
        require(msg.value > 0, "Stake amount must be greater than 0");
        require(arrivalDeadline > block.timestamp, "Deadline must be in the future");
        require(estimatedPace > 0, "Pace must be greater than 0");

        // Calculate distance using Haversine formula (migrated from distance.ts)
        uint256 distance = calculateDistance(
            startLocation.latitude,
            startLocation.longitude,
            targetLocation.latitude,
            targetLocation.longitude
        );

        bytes32 commitmentId = keccak256(
            abi.encodePacked(
                msg.sender,
                block.timestamp,
                startLocation.latitude,
                startLocation.longitude,
                targetLocation.latitude,
                targetLocation.longitude
            )
        );

        commitments[commitmentId] = ETACommitment({
            user: msg.sender,
            stakeAmount: msg.value,
            commitmentTime: block.timestamp,
            arrivalDeadline: arrivalDeadline,
            startLocation: startLocation,
            targetLocation: targetLocation,
            estimatedDistance: distance,
            estimatedPace: estimatedPace,
            fulfilled: false,
            successful: false,
            actualArrivalTime: 0,
            totalBetsFor: 0,
            totalBetsAgainst: 0
        });

        userTotalStaked[msg.sender] += msg.value;
        userTotalCommitments[msg.sender]++;

        emit CommitmentCreated(
            commitmentId,
            msg.sender,
            msg.value,
            arrivalDeadline,
            startLocation,
            targetLocation
        );

        return commitmentId;
    }

    /**
     * @dev Place a bet on someone's commitment
     * Enhanced social betting feature
     */
    function placeBet(bytes32 commitmentId, bool bettingFor) 
        external 
        payable 
        validCommitment(commitmentId) 
    {
        require(msg.value > 0, "Bet amount must be greater than 0");
        require(!commitments[commitmentId].fulfilled, "Commitment already fulfilled");
        require(commitments[commitmentId].user != msg.sender, "Cannot bet on own commitment");
        require(
            block.timestamp < commitments[commitmentId].arrivalDeadline,
            "Cannot bet after deadline"
        );

        commitmentBets[commitmentId].push(Bet({
            bettor: msg.sender,
            amount: msg.value,
            bettingFor: bettingFor,
            claimed: false
        }));

        if (bettingFor) {
            commitments[commitmentId].totalBetsFor += msg.value;
        } else {
            commitments[commitmentId].totalBetsAgainst += msg.value;
        }

        emit BetPlaced(commitmentId, msg.sender, msg.value, bettingFor);
    }

    /**
     * @dev Fulfill a commitment with proof of arrival
     * Enhanced location verification
     */
    function fulfillCommitment(
        bytes32 commitmentId,
        LocationData memory arrivalLocation
    ) external validCommitment(commitmentId) {
        ETACommitment storage commitment = commitments[commitmentId];
        require(commitment.user == msg.sender, "Only commitment creator can fulfill");
        require(!commitment.fulfilled, "Commitment already fulfilled");

        // Verify arrival location is within acceptable range of target
        uint256 arrivalDistance = calculateDistance(
            commitment.targetLocation.latitude,
            commitment.targetLocation.longitude,
            arrivalLocation.latitude,
            arrivalLocation.longitude
        );

        require(arrivalDistance <= 100, "Arrival location too far from target"); // 100m tolerance

        bool successful = block.timestamp <= commitment.arrivalDeadline;

        commitment.fulfilled = true;
        commitment.successful = successful;
        commitment.actualArrivalTime = block.timestamp;

        // Update reputation
        if (successful) {
            userSuccessfulCommitments[msg.sender]++;
            userReputationScore[msg.sender] = calculateReputationScore(msg.sender);
        }

        // Handle payouts
        _processPayouts(commitmentId);

        emit CommitmentFulfilled(
            commitmentId,
            msg.sender,
            successful,
            block.timestamp,
            successful ? commitment.stakeAmount : 0
        );
    }

    /**
     * @dev Calculate distance between two points using Haversine formula
     * Migrated from src/lib/distance.ts with precision scaling
     */
    function calculateDistance(
        int256 lat1,
        int256 lon1,
        int256 lat2,
        int256 lon2
    ) public pure returns (uint256) {
        // Convert to radians (scaled math)
        int256 dLat = (lat2 - lat1) * 31416 / 1800000; // π/180 * 1e6
        int256 dLon = (lon2 - lon1) * 31416 / 1800000;

        // Simplified Haversine for smart contract efficiency
        // Using approximation for small distances typical in punctuality scenarios
        int256 a = (dLat * dLat + dLon * dLon) / 1000000;

        return uint256(a) * EARTH_RADIUS_METERS / 1000000; // Return distance in meters
    }

    /**
     * @dev Calculate ETA based on distance and pace
     * Migrated from src/lib/distance.ts
     */
    function calculateETA(uint256 distance, uint256 pace) public pure returns (uint256) {
        // distance in meters, pace in minutes per mile * 100
        // Convert to minutes
        return (distance * pace) / (160934); // 1 mile = 1609.34 meters
    }

    /**
     * @dev Calculate user reputation score
     * Enhanced reputation system
     */
    function calculateReputationScore(address user) public view returns (uint256) {
        uint256 totalCommitments = userTotalCommitments[user];
        if (totalCommitments == 0) return INITIAL_REPUTATION;

        uint256 successfulCommitments = userSuccessfulCommitments[user];
        uint256 successRate = (successfulCommitments * 10000) / totalCommitments;

        // Reputation score between 0-10000 (0-100%)
        // Bonus for consistency, penalty for failures
        uint256 baseScore = successRate;

        // Bonus for having many successful commitments
        if (successfulCommitments >= 10) baseScore += 500;
        if (successfulCommitments >= 50) baseScore += 500;

        return baseScore > 10000 ? 10000 : baseScore;
    }

    /**
     * @dev Process payouts for fulfilled commitment
     * Internal function to handle stake and bet distributions
     */
    function _processPayouts(bytes32 commitmentId) internal {
        ETACommitment storage commitment = commitments[commitmentId];
        uint256 protocolFee = (commitment.stakeAmount * PROTOCOL_FEE) / 10000;

        if (commitment.successful) {
            // User gets their stake back minus protocol fee
            uint256 userPayout = commitment.stakeAmount - protocolFee;

            // Distribute winnings from losing bets
            uint256 totalWinnings = commitment.totalBetsAgainst;
            if (totalWinnings > 0) {
                uint256 winningsAfterFee = totalWinnings - ((totalWinnings * PROTOCOL_FEE) / 10000);
                userPayout += winningsAfterFee;
            }

            payable(commitment.user).transfer(userPayout);

            // Pay winning bettors (those who bet FOR)
            _payWinningBettors(commitmentId, true, commitment.totalBetsFor + commitment.totalBetsAgainst);

        } else {
            // User loses their stake
            // Pay winning bettors (those who bet AGAINST)
            _payWinningBettors(commitmentId, false, commitment.stakeAmount + commitment.totalBetsFor + commitment.totalBetsAgainst);
        }

        protocolFeeBalance += protocolFee;
    }

    /**
     * @dev Pay winning bettors their share
     */
    function _payWinningBettors(bytes32 commitmentId, bool winningBet, uint256 totalPool) internal {
        Bet[] storage bets = commitmentBets[commitmentId];
        uint256 totalWinningBets = winningBet ? commitments[commitmentId].totalBetsFor : commitments[commitmentId].totalBetsAgainst;

        if (totalWinningBets == 0) return;

        for (uint256 i = 0; i < bets.length; i++) {
            if (bets[i].bettingFor == winningBet && !bets[i].claimed) {
                uint256 share = (bets[i].amount * totalPool) / totalWinningBets;
                uint256 payout = share - ((share * PROTOCOL_FEE) / 10000);

                bets[i].claimed = true;
                payable(bets[i].bettor).transfer(payout);
            }
        }
    }

    /**
     * @dev Get commitment details
     */
    function getCommitment(bytes32 commitmentId) external view returns (ETACommitment memory) {
        return commitments[commitmentId];
    }

    /**
     * @dev Get user's reputation score
     */
    function getUserReputation(address user) external view returns (uint256) {
        return userReputationScore[user] == 0 ? INITIAL_REPUTATION : userReputationScore[user];
    }

    /**
     * @dev Withdraw protocol fees (owner only)
     */
    function withdrawProtocolFees() external onlyOwner {
        uint256 amount = protocolFeeBalance;
        protocolFeeBalance = 0;
        payable(owner).transfer(amount);
    }
}

